import Head from 'next/head'
import Navigation from './components/Nav'
import {
  Splash,
  Strategy,
  Subscribe,
  Team,
  HowWeInvest
} from './components/Banners'

export default function Home() {
  return (
      <>
        <Head>
          <title>Midori Capital</title>
        </Head>
        <style jsx global>{`
          html,
          body {
            height: 100%;
            width: 100%;
            background: #fff;
            padding: 0;
            margin: 0;
            font-family: -apple-system, BlinkMacSystemFont, Segoe UI, Roboto,
              Oxygen, Ubuntu, Cantarell, Fira Sans, Droid Sans, Helvetica Neue,
              sans-serif;
            overflow-x:hidden;
            scroll-behavior: smooth !important;
          }

          a { text-decoration: none; color: inherit;}

          svg { display: inline-block; vertical-align:top}

          .social {
            fill: rgb(255,255,255);
            transition: all 0.3s;
            margin-right: 7px
          }

          .bull {
            fill: rgb(0,0,0);
            transition: 0.3s all
          }

          .sibling:hover .bull {
            fill: rgb(0,100,0);
          }

          .sibling + .sibling .social img {
            position:relative;
            left: 0em;
            transition: 0.3s all
          }

          .sibling:hover + .sibling .social img {
            left: 0.2em;
            transform: scale(1.1, 1.1);
            border-bottom: 10px solid green
          }

          .social:hover {
            fill: rgb(0,50,0)
          }

          * {
            box-sizing: border-box;
          }

          .scewedbanner {
            display: flex;
            align-content: center;
            justify-content: center;
            width: 110%;
            position: relative; 
            left: -5%;
            top: -5%;
            overflow: hidden;
            transform: rotate(2deg);
            padding-bottom: 5em;
          }

          .scewedbanner > div {
            transform: rotate(-2deg);
            width: 80%;
          }

          #mc_embed_signup{background:#fff; clear:left; font:14px Helvetica,Arial,sans-serif; }

        `}</style>
      <Navigation />
      <Splash />
      <HowWeInvest />
      <InvestmentStrategySummary />
      <Team/>
      <Subscribe/>
    </>
  )
}
